  drone_data[:altitud] = Faker::Number.decimal(l_digits: 2)
  drone_data[:latitud] = random_lat
  drone_data[:longitud] = random_lon
  drone_data[:uav_id] = Uav.pluck(:id).sample

  DatosUav.create!(drone_data)
end

